import { Cards, HomePage } from "./Pages/index";
import { HashRouter as Router, Route, Switch } from "react-router-dom";

export const App = () => {
  return (
    <>
      <Router>
        <Switch>
          <Route path="/" element={<HomePage />} />
          <Route path="/tweets" element={<Cards />} />
          <Route path="*" element={<HomePage />} />
        </Switch>
      </Router>
    </>
  );
};
